import React from "react";

const Rating = ({ value, text, color }) => {
  console.log(value)
  return (
    <div className="rating">
      <span>
        <i
          style={{ color}}
          className={
            value >= 1
              ? "fa fa-star"
              : value >= 0.5
              ? "fas fa-star-half-alt"
              : "fas fa-star"
          }
        ></i>
      </span>
      <span>
        <i
        style={{ color}}
          className={
            value >= 2
              ? "fa fa-star"
              : value >= 1.5
              ? "fas fa-star-half-alt"
              : "fas fa-star"
          }
        ></i>
      </span>
      <span>
        <i
        style={{ color}}
          className={
            value >= 3
              ? "fa fa-star"
              : value >= 2.5
              ? "fas fa-star-half-alt"
              : "fas fa-star"
          }
        ></i>
      </span>
      <span>
        <i
          className={
            value >= 4
              ? "fa fa-star"
              : value >= 3.5
              ? "fas fa-star-half-alt"
              : "fas fa-star"
          }
        ></i>
      </span>
      <span>
        <i
          className={
            value >= 5
              ? "fa fa-star"
              : value >= 4.5
              ? "fas fa-star-half-alt"
              : "fas fa-star"
          }
        ></i>
      </span>
      <span>{text && text}</span>
    </div>
  );
};

export default Rating;
